import React from "react";
import Navbar from "./components/Navbar";
import MapComponent from "./components/MapComponent";
import "./App.css";

function App() {
  return (
    <div>
      <Navbar />
      <div className="map-container">
        <MapComponent />
      </div>
    </div>
  );
}

export default App;
